import React from 'react'
import './ModelOverlay.css';
import { Button } from 'react-bootstrap';

const ModelOverlay = () => {
  return (
    <div>
      <div className='modelOverlay'></div>
      <div className='modelDiv'>
        <h2>Enquiry Now</h2>
      </div>
      <Button>Open Model</Button>
    </div>
  )
}

export default ModelOverlay;
